<!DOCTYPE html>
<html lang="en">
<head>
  <meta charset="UTF-8">
  <title>Title</title>
</head>
<body>
<script>
  /**
   * @param {number} n
   * @return {number[]}
   */
  var printNumbers = function(n) {
    const res = [];
    let max = '';
    while(n-- > 0) max += '9'
    max = Number(max);
    let x = 1;
    while(x <= max) {
      res.push(x);
      x++;
    }
    return res;
  };
</script>
</body>
</html>
